    id: 2,
  },
];
function MyComponent() {
  const style = {
    color: "blue",
    fontSide: "30px",
  };
  return;
  <div style={style}> hello guys, i'm gonna show you:</div>;
}
function App() {
  return (
    <div>
      <button className="modal"> open win</button>
      {videos.map((video) => (
        <div key={video.id}>
          <p>
            hello guys, i'm gonna show you:
            {video.name} - {video.duration}
          </p>
        </div>
      ))}
    </div>
  );
}

export default App;
